import "./AddNFT.css";

export default function AddNFT() {
  const [formData, setFormData] = useState({
    name: "",
  });
  const { name } = formData;
  const { handleCreate } = props;

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevState) => ({
      ...prevState,
      [name]: value,
    }));
  };

  return (
    <div>
      <form
        onSubmit={(e) => {
          e.preventDefault();
          handleCreate(formData);
        }}
      >
        <h3>
          Create <NFT></NFT>
        </h3>
        <label>
          Title:
          <input
            type="text"
            name="title"
            value={title}
            onChange={handleChange}
          />
        </label>
        <label>
          Image Link:
          <input
            type="text"
            name="image_link"
            value={image_link}
            onChange={handleChange}
          />
        </label>
        <label>
          Created Date:
          <input
            type="text"
            name="created_date"
            value={created_date}
            onChange={handleChange}
          />
        </label>
        <label>
          Collection Type:
          <input
            type="text"
            name="collection_type"
            value={collection_type}
            onChange={handleChange}
          />
        </label>
        <label>
          Mint Number:
          <input
            type="text"
            name="mint_num"
            value={mint_num}
            onChange={handleChange}
          />
        </label>
        <label>
          Total Minted:
          <input
            type="text"
            name="total_minted"
            value={total_minted}
            onChange={handleChange}
          />
        </label>
        <label>
          Lowest Ask:
          <input
            type="text"
            name="lowest_ask"
            value={total_minted}
            onChange={handleChange}
          />
        </label>
        <button>Submit</button>
      </form>
    </div>
  );
}
